    true,nt"url": null,nt"notes": "<p>Medicare is statutorily required to adjust
    payments for physician fee schedule services to account for differences in costs
    due to geographic location. There are currently 89 different localities which have
    not been revised since 1997. In the CY 2009 Physician Fee Schedule notice of proposed
    rulemaking, we indicated that we would post on the CMS website a preliminary study
    of several options for revising the payment localities.</p>n",nt"license_title":
